import { useState } from "react";

function App() {
  const [fruits, setFruits] = useState([
    { id: 1, nom: "Abricot" },
    { id: 2, nom: "Banane" },
    { id: 3, nom: "P" },
  ]);

  return (
    <div> 
      <h1> Bonjour </h1>
      <h3> Liste de fruits </h3>
      <ul>
        {fruits.map((fruit) => {
          return <li key={fruit.id}> {fruit.id}: {fruit.nom}</li>;
        })}   
      </ul>
    </div>
  );
}

export default App;
